import '../App.css';

class BottomSide extends React.Component {
    render() {
        return (
            <div className='fixed'>
                <table>
                    <tr>
                        <td className='rcorners2'> 1</td>
                        <td className='rcorners2'> 2</td>
                        <td className='rcorners2'> 3</td>
                        <td className='rcorners2'> 4</td>
                    </tr>
                </table>
            </div>
        );
    }
}

export default BottomSide;
